const countingValleys = require("./countingValleys");

test("Test case 1: UDDDUDUU", () => {
	expect(countingValleys("UDDDUDUU")).toBe(1);
});

test("Test case 2: DDUUDDUDUUUD", () => {
	expect(countingValleys("DDUUDDUDUUUD")).toBe(2);
});

test("Test case 3: DDUDDUUDUU", () => {
	expect(countingValleys("DDUDDUUDUU")).toBe(1);
});

test("Test case 4: -realy long string-", () => {
	expect(countingValleys(""))
		.toBe(18);
});
